import "./App.css";
import * as dfd from "danfojs";
import { useEffect, useState } from "react";

function App() {
  const [data, setData] = useState();

  const getData = async () => {
    try {
      let df = await dfd.readCSV(
        "/Users/omarbailey/Documents/Gym/Omar Random Workout Generator.csv"
      );
      setData(df);
    } catch (err) {
      console.log(err);
    }
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <div>
      <h1> Workout Generator</h1>
      <pre>{data}</pre>
    </div>
  );
}

export default App;
